syntax = "proto3";

message LoginRequest {
    string email = 2;
    string password = 3;
}

message CreateRequest {
    string name = 1;
    string email = 2;
    string password = 3;
}

message LoginCreateResponse {
    message object {
        string _id = 1;
        string name = 2;
        string email = 3;
        string password = 4;
        string apiKey = 5;
        bool active = 6;
    }

    object data = 1;
}

service User {
    rpc Login(CreateRequest) returns (LoginCreateResponse);
    rpc Create(CreateRequest) returns (LoginCreateResponse);
}

syntax = "proto3";

message CreateRequest {
    string apiKey = 1;
    string name = 2;
}

message CreateResponse {
    message object {
        string projectId = 1;
        string name = 2;
    }

    object data = 1;
}

message RemoveRequest {
    string apiKey = 1;
    string projectId = 2;
}

message RemoveResponse {
    string message = 1;
}

message ListRequest {
    string apiKey = 1;
}

message ListResponse {
    message object {
        string projectId = 1;
        string name = 2;
    }

    repeated object data = 1;
}

service Project {
    rpc Create(CreateRequest) returns (CreateResponse);
    rpc Remove(RemoveRequest) returns (RemoveResponse);
    rpc List(ListRequest) returns (ListResponse);
}

syntax = "proto3";

message GetRequest {
    string apiKey = 1;
    string projectId = 2;
    repeated string tokens = 3;
}

message GetResponse {
    message object {
        string token = 1;
        string payload = 2;
    }

    repeated object data = 1;
}

message ListRequest {
    string apiKey = 1;
    string projectId = 2;
}

message ListResponse {
    message object {
        string token = 1;
        string payload = 2;
    }

    repeated object data = 2;
}

message CreateRequest {
    string apiKey = 1;
    string projectId = 2;
    string payload = 3;
}

message CreateResponse {
    message object {
        string token = 1;
    }

    string message = 2;
    object data = 3;
}

service Data {
    rpc Get(GetRequest) returns (GetResponse);
    rpc List(ListRequest) returns (ListResponse);
    rpc Create(CreateRequest) returns (CreateResponse);
}
